import React from "react";
import { 
  Routes,
  Route,
  Link
} from 'react-router-dom'
import Home from "./container/Home";

function App() {
  return (
          <div className="bg">
            <Routes>
              <Route element={<Home/>} path={'/'}/>
            </Routes>
          </div>
      )

}

export default App;
